import { combineReducers } from "redux"
import {
    getLiveAuctionListReducer, getSoldAuctionListReducer, getExpiredAuctionListReducer, getLotsListReducer,
    getUpCommingAuctionListAction
} from './AuctopnReducer'

export const MainReducer = combineReducers({
    getLiveAuctionListReducer, getSoldAuctionListReducer, getExpiredAuctionListReducer, getLotsListReducer,
    getUpCommingAuctionListAction,
})
